  import React from 'react'
  import { MDXTag } from '@mdx-js/tag'


export default class MDXContent extends React.Component {
  constructor(props) {
    super(props)
    this.layout = null
  }
  render() {
    const { components, ...props } = this.props

    return <MDXTag
             name="wrapper"

             components={components}><MDXTag name="h1" components={components} props={{"id":"topics"}}>{`Topics`}</MDXTag>
<MDXTag name="h2" components={components} props={{"id":"profile"}}>{`profile`}</MDXTag>
<MDXTag name="h3" components={components} props={{"id":"subscribe-profile"}}><MDXTag name="inlineCode" components={components} parentName="h3">{`subscribe`}</MDXTag>{` profile`}</MDXTag>
<MDXTag name="h3" components={components} props={{"id":"subscription-messages"}}>{`Subscription Messages`}</MDXTag>
<MDXTag name="h4" components={components} props={{"id":"message-1"}}>{`Message #1`}</MDXTag>
<MDXTag name="p" components={components}>{`a profile (agent, affiliate or office) was created`}</MDXTag>
<MDXTag name="h3" components={components} props={{"id":"payload"}}>{`Payload`}</MDXTag>
<MDXTag name="pre" components={components}><MDXTag name="code" components={components} parentName="pre" props={{"className":"language-json"}}>{`{
  "type": "Notification",
  "id": "https://you.example.com/inbox/12345",
  "timestamp": 1550503972767,
  "agent": "https://user.example.com/profile/card#me",
  "instrument": "https://application.example.com/profile/card#me",
  "topic": "profile",
  "object": {
    "type": "AddAction",
    "agent": "https;//user.example.com/profile/card#me",
    "object": {
      "id": "https://user.example.com/profile/card"
    }
  }
}
`}</MDXTag></MDXTag>
<MDXTag name="h4" components={components} props={{"id":"message-2"}}>{`Message #2`}</MDXTag>
<MDXTag name="p" components={components}>{`a profile (agent, affiliate or office) was updated`}</MDXTag>
<MDXTag name="h3" components={components} props={{"id":"payload-1"}}>{`Payload`}</MDXTag>
<MDXTag name="pre" components={components}><MDXTag name="code" components={components} parentName="pre" props={{"className":"language-json"}}>{`{
  "type": "Notification",
  "id": "https://you.example.com/inbox/12345",
  "timestamp": 1550503972767,
  "agent": "https://user.example.com/profile/card#me",
  "instrument": "https://application.example.com/profile/card#me",
  "topic": "profile",
  "object": {
    "type": "UpdateAction",
    "actionStatus": "ActiveActionStatus",
    "agent": {
      "type": "Organization",
      "telephone": "079.706.7065 x6341",
      "email": "user@example.com",
      "faxNumber": "(873) 271-4802",
      "contactPoint": [
        {
          "type": "ContactPoint",
          "name": "Work",
          "telephone": "1-364-127-9618 x20418",
          "faxNumber": "834.320.1602",
          "email": "user@example.com"
        }
      ],
      "parentOrganization": [
        "http://example.com"
      ]
    },
    "endTime": "2019-02-18T20:28:43Z",
    "error": {
      "type": "string"
    },
    "instrument": {
      "type": "string"
    },
    "location": {
      "type": "string"
    },
    "object": {
      "type": "string"
    },
    "participant": {
      "type": "string"
    },
    "result": {
      "type": "string"
    },
    "startTime": "2019-02-18T20:28:43Z",
    "target": {}
  }
}
`}</MDXTag></MDXTag>
           </MDXTag>
  }
}
